import React from 'react';

export default function VisitsHeader() {
    return (
        <tr className='p-6 bg-blue'>
            <th>Nom</th>
            <th>Prénom</th>
            <th>Entreprise</th>
            <th>Motif</th>
            <th>Personne rencontrée</th>
            <th>Date entrée</th>
            <th>Date Sortie</th>
            <th></th>
        </tr>
    );
}
